import {
	BrowserRouter as Router,
	Routes as Switch,
	Route,
} from "react-router-dom";

const App = () => {
	return (
		<Router>
			<nav></nav>
			<Switch>
				<Route to="/" element={<h1>Home</h1>} />
				<Route to="/people" element={<h1>People</h1>} />
			</Switch>
		</Router>
	);
};

export default App;
